import React, { useEffect, useRef, useState } from "react";
import L from "leaflet";

const Map = ({ jsonData }) => {
    const scrollerRef = useRef(null);
    const mapRef = useRef(null);
    const [legendItems, setLegendItems] = useState([]);

    useEffect(() => {
        const handleWheel = (event) => {
            event.preventDefault();
            if (scrollerRef.current) {
                scrollerRef.current.scrollLeft += event.deltaY;
            }
        };

        const scroller = scrollerRef.current;
        if (scroller) {
            scroller.addEventListener("wheel", handleWheel, { passive: false });
        }

        return () => {
            if (scroller) {
                scroller.removeEventListener("wheel", handleWheel);
            }
        };
    }, []);

    useEffect(() => {
        if (mapRef.current) {
            // Create the map
            const map = L.map(mapRef.current).setView([16.22525, 74.8424], 16);

            // Add tile layer
            L.tileLayer("https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png", {
                maxZoom: 29,
                minZoom: 2,
            }).addTo(map);

            // Define colors for sensor types
            const colorMap = {
                farmland: "green",
                valve: "orange",
                moisture: "blue",
                npk: "red",
            };

            // Create a set to hold unique sensor types for the legend
            const uniqueTypes = new Set();

            // Merge moisture values into the section_device data
            const sectionDeviceWithMoisture = jsonData.location_coordinates.section_device.map(device => {
                // Find matching moisture value from device_values
                const moistureData = jsonData.device_values.moisture_device_value.find(
                    moisture => moisture.section_device_id === device.section_device_id
                );
                return { ...device, moisture_value: moistureData ? moistureData.moisture_value : null };
            });

            // Process each data point
            sectionDeviceWithMoisture.forEach((data) => {
                uniqueTypes.add(data.device_name); // Add type to the set

                const deviceLatLon = data.device_location.split(',').map(coord => parseFloat(coord));

                if (data.device_name === "moisture") {
                    // Display moisture value in the popup
                    const popupContent = `
                        ${data.section_name} Moisture Sensor
                        <br>Moisture Value: ${data.moisture_value ? `${data.moisture_value}%` : "N/A"}
                    `;
                    L.circle([deviceLatLon[0], deviceLatLon[1]], {
                        radius: 50, // Example radius for moisture
                        fillColor: colorMap.moisture,
                        color: colorMap.moisture,
                        fillOpacity: 0.4,
                        weight: 1,
                    }).addTo(map).bindPopup(popupContent);
                } else if (data.device_name === "valve") {
                    // Display valve status in the popup
                    const popupContent = `${data.section_name} Valve (Status: ${data.valve_status})`;
                    L.circleMarker([deviceLatLon[0], deviceLatLon[1]], {
                        radius: 8,
                        fillColor: colorMap.valve,
                        color: colorMap.valve,
                        fillOpacity: 0.6,
                        weight: 2,
                    }).addTo(map).bindPopup(popupContent);
                }
            });

            // Add farmland polygon
            jsonData.location_coordinates.farm_coordinates.forEach((coord, index) => {
                const farmlandLayer = L.polygon(coord.split(',').map(c => [parseFloat(c[0]), parseFloat(c[1])]), { color: colorMap.farmland }).addTo(map);
                farmlandLayer.bindPopup("Farmland Area");
            });

            // Create legend items dynamically
            const legendData = Array.from(uniqueTypes).map(type => ({
                type,
                color: colorMap[type] || "gray", // Fallback color
            }));

            setLegendItems(legendData);

            // Fit the map to the farmland bounds if available
            const bounds = L.latLngBounds(jsonData.location_coordinates.farm_coordinates);
            map.fitBounds(bounds);

            // Cleanup on component unmount
            return () => {
                map.remove();
            };
        }
    }, [jsonData]);

    return (
        <div ref={scrollerRef} className="borderring p-0" style={{ overflow: "hidden", scrollbarWidth: "none", msOverflowStyle: "none" }}>
            <div className="borderring" style={{ position: "relative", border: 'none' }}>
                <h6 className="text-secondary" style={{ zIndex: 2, position: "relative", top: '0px', left: '0px' }}>Field Overview</h6>
                <div
                    ref={mapRef}
                    style={{
                        width: "100%",
                        height: "445px",
                        scale: "1.45",
                        overflow: "hidden",
                        position: "relative"
                    }}
                >
                </div>

                {/* Dynamic Legend */}
                <div style={{
                    position: "absolute",
                    top: "10px",
                    right: "10px",
                    backgroundColor: "white",
                    padding: "6px",
                    borderRadius: "5px",
                    boxShadow: "0 0 5px rgba(0,0,0,0.5)",
                    zIndex: 10,
                }}>
                    {legendItems.map((item) => (
                        <div key={item.type} style={{ display: "flex", alignItems: "center" }}>
                            <div style={{ width: "10px", height: "10px", backgroundColor: item.color, marginRight: "5px" }}></div>
                            <span style={{fontSize:'13px'}}>{item.type.charAt(0).toUpperCase() + item.type.slice(1)}</span>
                        </div>
                    ))}
                </div>
            </div>
        </div>
    );
};

export default Map;
